import React, { Component } from 'react';
import { IoArrowBackCircle } from 'react-icons/io5';
import './Profile.css';

class Profile extends Component {

  constructor(props) {
    super(props);
    this.goHome = this.goHome.bind(this);
    this.goLogin = this.goLogin.bind(this);
  }

  goHome() {
    this.props.history.push('/');
  }

  goLogin() {
    this.props.history.push('/login');
  }

  goProfile() {
    this.props.history.push('/profile');
  }

  render() {
    return (
      <main className="profile">
        <button className="profile-back" onClick={ this.goHome }>
          <IoArrowBackCircle />
        </button>

        <div className="profile-title">
          나의 정보

          <div className="profile-buttons">
            <button onClick={ this.goLogin }>로그아웃</button>
          </div>
        </div>

        <section className="profile-content">

          <div className="profile-profile">
            <div className="profile-sub-title">
              프로필
              <button onClick={ this.goProfile }>변경</button>
            </div>
            <div className="profile-item">사진</div>
            <div className="profile-item">이름</div>
            <div className="profile-item">이메일</div>
            <div className="profile-item">설명</div>
          </div>

          <div className="profile-setting">
            <div className="profile-sub-title">
              설정
            </div>
            <div className="profile-item">
              언어
            </div>
            <div className="profile-item">
              테마
            </div>
          </div>
        </section>
      </main>
    );
  }

}

export default Profile;
